window.bookSummaryJSON = "<p><b>A mother’s greatest wish—or darkest nightmare—comes true in this chilling classic audiobook thriller from the Master of Suspense, Dean Koontz.</b></p> <p>“Koontz puts his readers through the emotional wringer.”–The Associated Press</p> <p>In the year since her son Danny’s tragic death, Tina Evans has suffered incredible heartache. But now, with her Vegas show about to premiere, Tina might be ready to put her grief behind her and start over.</p> <p>Until a shocking message appears on the chalkboard in Danny's room: NOT DEAD. Those two words send her on a terrifying journey from the bright lights of Las Vegas to the cold shadows of the High Sierras, where she uncovers a terrible secret.</p>"; 
